import { StyleSheet } from 'react-native';

const styles = StyleSheet.create({
    container: {
        padding: 10,
        backgroundColor: '#eee',
        height: '100%'
    },
    textInput: {
        padding: 10,
        backgroundColor: '#eee',
        marginVertical: 5
    }
});

export default styles;
